import * as styleSass from '../../../styles/usable.module.scss'

function Button(props) {
  console.log(props)
  return (
    <>
      {props.styleProp ? (
        <button
          style={props.styleProp}
          className={`${styleSass.button} ${props.className} `}
        >
          {props.children}
        </button>
      ) : (
        <button className={`${styleSass.button} ${props.className} `}>
          {props.children}
        </button>
      )}
    </>
  )
}
export default Button
